const ScoreList = ({ scores }) => {
  if (!thoughts.length) {
    return <h3>No Thoughts Yet</h3>;
  }

  return (

<div className="gif-grid">
{scores.map((score) => (
  <div className="gif-item" key={score._id}>
    <p>{score.wallet}</p>
  </div>
))}
</div>
  );
};

export default ScoreList;
